const onboardingDataByPlatformType: Partial<Record<PlatformType, OnboardingData>> = {
    [PlatformType.Android]: androidOnboardingData,
    [PlatformType.Huawei]: androidOnboardingData,
    [PlatformType.iOS]: iOsOnboardingData,
}

export async function up(db: Db): Promise<void> {
    await Promise.all([db.collection(onboardingCollectionName).deleteMany({}), db.collection(newFeaturesCollectionName).deleteMany({})])

    const tasks: Promise<void>[] = Object.keys(appVersionByPlatformType).map(async (platformType) => {
        const onboarding: Onboarding = {
            appVersion: appVersionByPlatformType[<PlatformType>platformType]!,
            platformType: <PlatformType>platformType,
            isVisible: true,
            data: onboardingDataByPlatformType[<PlatformType>platformType]!,
        }
        // const newFeatures: NewFeatures = { ...onboarding, data: newFeaturesDataByPlatformType[platformType], viewsCount: 1 };

        await Promise.all([
            db.collection(onboardingCollectionName).insertOne(onboarding),
            // db.collection(newFeaturesCollectionName).insertOne(newFeatures)
        ])
    })

    await Promise.all(tasks)
}
